  'use strict';

  {
    //初期設定
    function setWord() {
      timer.textContent = 'Time:' + time;
      random = Math.floor(Math.random() * words.length);
      word = words.splice([random],1)[0];
      wordJp = wordsJp.splice([random],1)[0];
      targetEn.textContent = word;
      targetJp.textContent = wordJp;
      loc = 0;
    }
    //終了処理の関数
    function finish() {
      clearInterval(countdown);
      timer.textContent = '正解数は' + count + '個でした!';
      typeMiss.textContent = 'タイプミスは' + missCount + '個でした!';
    }

    const words = [
      'kyouitinitiwotanosikuikitemiru',
      'seityounimutyuuninaru',
      'sukinahitotoissyoniinasai',
      'sakiwoakarukumiyou',
      'sukinakotowoyatteikinasai',
      'taisetunahitowotaisetuni',
      'utagauyorisinnzitemiyou',
      'mousugitakotohawasureyou',
      'siawasehaatarimaenonakaniaru',
      'iikotohaiyanakotonoatoniyattekuru'

    ];
    const wordsJp = [
      '今日1日を楽しく生きてみる',
      '成長に夢中になる',
      '好きな人と一緒にいなさい',
      '先を明るく見よう',
      '好きなことをやっていきさない',
      '大切な人を大切に',
      '疑うより信じてみよう',
      'もう過ぎたことは忘れよう',
      '幸せは当たり前の中にある',
      'いい事は嫌な事の後にやってくる'



    ];
    let time = 30;
    let word;
    let wordJp;
    let random;
    let loc = 0;
    let startTime;
    let isPlaying = false;
    let count = 0;
    let missCount = 0;
    let countdown;
    let isPlayEnd = false;

    const timer = document.getElementById('timer');

    const typeMiss = document.getElementById('typeMiss');

    const target = document.getElementById('targetEn');

    const targetJp = document.getElementById('targetJp');

    const base64 = ""

    const sound = new Audio("data:audio/mp3;base64," + base64);




    document.addEventListener('click', () => {
      if (isPlaying === true) {
        return;
      }
      isPlaying = true;
      setInterval(() => {
        timer.textContent = 'Time:' + --time;
        if(time <= 0) finish();
      },1000);
      startTime = Date.now();
      setWord();

    });

    document.addEventListener('keydown', e => {
      if (isPlayEnd === true) {
        return;
      }

      if (e.key !== word[loc]) {
        //エラー音入れたい
        sound.play();
        sound.currentTime = 0;
        missCount++;
        return;
      }

      loc++;

      // 1: _urf
      // 2: __rf
      // 3: ---f
      // 4: ----
      targetEn.textContent = '_'.repeat(loc) + word.substring(loc);

      if (loc === word.length) {
        count++;
        setWord();
      }
    });
    document.addEventListener('keyup', () => {
      if (isPlayEnd === true) {
        return;
      }


        if (time <= 0) {

          isPlayEnd = true;

          const image = document.getElementById('video-area');
          image.innerHTML = '<video autoplay="autoplay" loop="loop" muted="muted" src="/videos/ending.mov"></video>';
          targetJp.textContent = 'Nice!!Riding!!';
          target.innerHTML = '';
          const elapsedTime = ((Date.now() - startTime) / 1000).toFixed(2);
          const result = document.getElementById('result');
          result.textContent = `Finishd! ${elapsedTime} seconds!`;

          const twitterButtom = document.getElementById('twitter-buttom');
          //textの中身にテンプレートリテラルを反映させれたら結果をツイートできる
          twitterButtom.href = "https://twitter.com/share?url=https://surf-typing.herokuapp.com/&text=&hashtags=surftyping,海,タイピングゲーム";
          twitterButtom.innerHTML = '<i class="fab fa-twitter share-button"></i>';


          return;
        }
      });
  }
